import React from 'react';

class Results extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
        <div className="row">
            <div className="col fw-bold fs-2">
                <div>Un-Resisted: <span className="text-dark"></span></div>
                <div>Recommended Additions: <span className="text-dark"></span></div>
                <div>Obsolete Pokemon: <span className="text-dark"></span></div>
                <div>Rating: <span className="text-dark"></span></div>
            </div>
        </div>
        );
    }
};

export default Results;
